import VueRouter from 'vue-router';
import login from '../components/login/Login';
import indexEmployee from '../components/employee/indexEmployee';
import register from '../components/login/Register';
import personalCenter from '../components/login/personalCenter'
import index from '../components/Index'

const routes = [
    {
        path:'/',
        name:'login',
        component:login
    },
    {
        path:'/index',
        name:'index',
        component:index,
        children:[
            {
                path: '/personalCenter',
                name: 'personalCenter',
                meta:{
                  title:"扶뒬못"
                },
                component: personalCenter
            }
        ]
    },
    {
        path:'/indexEmployee',
        name:'indexEmployee',
        component:indexEmployee
    },
    {
        path:'/register',
        name:'register',
        component:register
    },
];

const router = new VueRouter({
    mode:'history',
    routes
});


export default router;
